import { EmptyState, Layout, Page } from '@shopify/polaris';
import { ResourcePicker, TitleBar } from '@shopify/app-bridge-react';
import React from 'react';

const img = 'https://media3.dealerdecoque.fr/themes/ddcV2/img/logo_ddc.svg';

class Index extends React.Component {
  state = { open: false };
  render() {
    return (
      //test
      <html>
        <body>

            <h1 class="titre">Ajout de produits</h1>

            <input type="button" value="test"></input>

          <img src="https://media3.dealerdecoque.fr/themes/ddcV2/img/logo_ddc.svg" alt=""></img>
        </body>
      </html>
    );
  }
}

export default Index;
